			<title><![CDATA[Entbannungsantrag]]></title>
			<link><![CDATA[https://forum.dlrp.eu/forum/index.php?thread/11852-entbannungsantrag/]]></link>
			<description><![CDATA[Hiermit ist dein Entbannungsantrag <strong><span style="color:#FF0000;">Abgelehnt.</span></strong><br><br>Grund hierfür : <strong>§1.6. Du trägst die Verantwortung über deinen Account! Es zählen keine Aussagen wie: ‘’Das war mein Bruder’’.</strong><br><strong>Desweiteren Spammen von DMS, Spammen von einem DC-Ticket inkl. Drohen.</strong><br><strong>Merhfache</strong>…]]></description>
			<pubDate>Wed, 16 Nov 2022 10:15:33 +0000</pubDate>
			<dc:creator><![CDATA[[DLRP] Cha0sGirL]]></dc:creator>
			<guid><![CDATA[https://forum.dlrp.eu/forum/index.php?thread/11852-entbannungsantrag/]]></guid>
						<content:encoded><![CDATA[<p class="text-center">Hiermit ist dein Entbannungsantrag <strong><span style="color:#FF0000;">Abgelehnt.</span></strong><br><br>Grund hierfür : <strong>§1.6. Du trägst die Verantwortung über deinen Account! Es zählen keine Aussagen wie: ‘’Das war mein Bruder’’.</strong><br><strong>Desweiteren Spammen von DMS, Spammen von einem DC-Ticket inkl. Drohen.</strong><br><strong>Merhfache Regelbrüche im Discord.<br><br>Tipp für die Zukunft, vielleicht solltest du Lernen das auch Teamler ein Privat leben haben &amp; keine 24/7 vor dem PC sitzen.<br>Lerne dich in Geduld, Akzeptanz.</strong></p>]]></content:encoded>
						<slash:comments><![CDATA[1]]></slash:comments>
