size: 12pt;">Liebes DLRP Team Ich möchte mich hiermit aufrichtig bei dem ganzen Serverteam für meinen dummen fehler entschuldigen.Mir ist klar geworden das was ich gemacht habe nicht richtig wahr und das was ich gemacht habe nicht auf einen Server gehört.Mir ist auch bewusst geworden, dass ich euch damit evtl. geschädigt habe.Es ist vollkommen Verständlich, dass ich vom Server gebannt wurde aber ich würde gerne mit meinen freunden wieder zocken.Es würde mich deswegen umso mehr Freuen wenn ich noch eine chance bekommen darf,um crimelife mit meinen freunden auf eurem server zu zocken.Es tut mir wirklich leid, ich hätte über die Konsequenzen nachdenken sollen hiermit verspreche ich dem gesamten Serverteam, dass solch eine kake nie wieder vorkommen wird und ich hoffe, dass man mir eine Neue Chance gibt Ich bereue die Aktion die ich getan habe und dies wird nicht wieder vorkommen.</span></span></span></strong></p><p><strong><span style="color:rgb(0,0,0);"><span style="font-family:Arial;"><span style="font-size: 12pt;"><span></span></span></span></span></strong></p><p><strong></strong></p><p><br><strong><span style="color:rgb(152,0,0);"><span style="font-family:Arial;"><span style="font-size: 12pt;">MFG Julian</span></span></span></strong></p>]]></content:encoded>
